  _Booking.default.searchbar.clear().type(dataJson.Searchplace);
  _Booking.default.searchbar.clear().type(dataJson.Searchconfirmationnumber);
  _Booking.default.searchbar.clear().type(dataJson.Searchdate);
  _Booking.default.Result.should('be.visible');
  _Booking.default.searchbar.clear().type(dataJson.Searchstatus1);
  _Booking.default.Result.should('be.visible');
  _Booking.default.searchbar.clear().type(dataJson.Searchstatus2);
  _Booking.default.Result.should('be.visible');
  _Booking.default.searchbar.clear().type(dataJson.Searchpercentage);
  _Booking.default.Result.should('be.visible');
  _Booking.default.searchbar.clear().type(dataJson.Space);
  _Booking.default.searchbar.clear().type(dataJson.Forabookingid);
  _Booking.default.searchbar.clear().type(dataJson.Suppliername);
  cy.wait(2000);
  _Booking.default.Cancel.click();
});

